import React from 'react';
import {VictoryChart,VictoryLine,VictoryPie} from "victory";
import {Heading} from 'evergreen-ui';
const UserDetails = ({year,week}) => {

    return(
        <div className="graphs">
            <Heading size={800}>Monthly activity</Heading>
            <VictoryChart>
                <VictoryLine
                    data={[
                        { x: "Jan", y: year.Jan },
                        { x: "Feb", y: year.Feb },
                        { x: "Mar", y: year.Mar },
                        { x: "Apr", y: year.Apr},
                        { x: "May", y: year.May },
                        { x: "Jun", y: year.Jun },
                        { x: "Jul", y: year.Jul },
                        { x: "Aug", y: year.Aug },
                        { x: "Sep", y: year.Sep },
                        { x: "Oct", y: year.Oct },
                        { x: "Nov", y: year.Nov },
                        { x: "Dec", y: year.Dec }
                        ]}
                />
            </VictoryChart>
            <Heading size={800}>Daily activity</Heading>
            <VictoryPie
                colorScale={["#084B8A", "#00783E", "#00783E", "#EFBB35","#234361","#008f68", "#6DB65B"]}
                data={[
                    { x: "Mon", y: week.Mon },
                    { x: "Tue", y: week.Tue},
                    { x: "Wed", y: week.Wed },
                    { x: "Thu", y: week.Thu },
                    { x: "Fri", y: week.Fri },
                    { x: "Sat", y: week.Sat },
                    { x: "Sun", y: week.Sun }
                    ]}
                    />
        </div>
    )
}
export default UserDetails;
